import image from "./images/wallpaper.png";
function BackgroundImage() {
  return (
    <div
      style={{
        backgroundImage: `url(${image})`,
        backgroundRepeat: "no-repeat",
        backgroundSize: "contain",
        height: 600,
        width: 600
      }}
    ></div>
  );
}
export { BackgroundImage };
